import React from "react";
import { v4 as uuidv4 } from "uuid";

export default function TimelineItem(props) {
  return (
    <div className="timeline-item clearfix">
      <h5 className="item-period current">
        {props.job.from} - {props.job.to}
      </h5>
      <span className="item-company">
        <a
          style={{ color: "#aaa" }}
          href={props.job.company_url}
          target="_blank"
        >
          {props.job.company}
        </a>
      </span>
      <h4 className="item-title">{props.job.title}</h4>
      <ul>
        {props.job.tasks.map((task) => (
          <li dangerouslySetInnerHTML={task.__html} />
        ))}
      </ul>
    </div>
  );
}
